import React from 'react'
import App from './App.js'
import Dog from './Dog.js'



export default class DogBar extends React.Component {

    render(){
        return (
            <div id="dog-bar">
                {this.props.dogs.map(dog => <Dog name={dog.name} image={dog.image}  />)}            
              </div>
        )
    }
}
